import React from 'react';

const Selected_ItemList = props => {
  return (
    <div className='col s6 m6'>
      <div className='card red lighten-3'>
        <div className='card-content red-text'>
          <input
            className='col s12'
            type='number'
            id={props.name}
            value={props.item.req}
            onChange={props.change}
            autoFocus
          />
          <span className='white-text' style={{ fontSize: 10 }}>
            {props.name}
          </span>
          <i
            className='material-icons'
            onClick={props.delt}
            id={props.name}
            style={{ fontSize: '3.3rem', left: '10%', cursor: 'pointer' }}
          >
            delete_forever
          </i>
        </div>
      </div>
    </div>
  );
};

export default Selected_ItemList;
